import React from "react";
import pic1 from "../images/img1.jpg"

export default function Body(){
    return(
        <>
        <div className="front--div">
         <img src={pic1} alt="" className="front--pic"/>
         
        <div className="h1">
         <h1 className="frontpic--h1">GET OF YOUR ASS </h1>
         <h2 className="frontpic--h2">AND COME TO THE GYM</h2>
         </div>
         
        </div>

         

        </>
    )
}
